    body: '{"messages": [{"content": "You are Crew Manager. You are a seasoned manager
      with a knack for getting the best out of your team.\nYou are also known for
      your ability to delegate work to the right people, and to ask the right questions
      to get the best out of your team.\nEven though you don''t perform tasks by yourself,
      you have a lot of experience in the field, which allows you to properly evaluate
      the work of your team members.\nYour personal goal is: Manage the team to complete
      the task in the best way possible.\nYou ONLY have access to the following tools,
      and should NEVER make up tools that are not listed here:\n\nTool Name: Delegate
      work to coworker(task: str, context: str, coworker: Optional[str] = None, **kwargs)\nTool
      Description: Delegate a specific task to one of the following coworkers: Senior
      Writer\nThe input to this tool should be the coworker, the task you want them
      to do, and ALL necessary context to execute the task, they know nothing about
      the task, so share absolute everything you know, don''t reference things but
      instead explain them.\nTool Arguments: {''task'': {''title'': ''Task'', ''type'':
      ''string''}, ''context'': {''title'': ''Context'', ''type'': ''string''}, ''coworker'':
      {''title'': ''Coworker'', ''type'': ''string''}, ''kwargs'': {''title'': ''Kwargs'',
      ''type'': ''object''}}\nTool Name: Ask question to coworker(question: str, context:
      str, coworker: Optional[str] = None, **kwargs)\nTool Description: Ask a specific
      question to one of the following coworkers: Senior Writer\nThe input to this
      tool should be the coworker, the question you have for them, and ALL necessary
      context to ask the question properly, they know nothing about the question,
      so share absolute everything you know, don''t reference things but instead explain
      them.\nTool Arguments: {''question'': {''title'': ''Question'', ''type'': ''string''},
      ''context'': {''title'': ''Context'', ''type'': ''string''}, ''coworker'': {''title'':
      ''Coworker'', ''type'': ''string''}, ''kwargs'': {''title'': ''Kwargs'', ''type'':
      ''object''}}\n\nUse the following format:\n\nThought: you should always think
      about what to do\nAction: the action to take, only one name of [Delegate work
      to coworker, Ask question to coworker], just the name, exactly as it''s written.\nAction
      Input: the input to the action, just a simple python dictionary, enclosed in
      curly braces, using \" to wrap keys and values.\nObservation: the result of
      the action\n\nOnce all necessary information is gathered:\n\nThought: I now
      know the final answer\nFinal Answer: the final answer to the original input
      question\n\nCurrent Task: Write one amazing paragraph about AI.\n\nThis is the
      expect criteria for your final answer: A single paragraph with 4 sentences.
      \n you MUST return the actual complete content as the final answer, not a summary.\n\nBegin!
      This is VERY important to you, use the tools available and give your best Final
      Answer, your job depends on it!\n\nThought:\nI need to delegate the task of
      writing an amazing paragraph about AI to the Senior Writer. I will provide all
      necessary context to ensure they understand the task fully.\n\nAction: Delegate
      work to coworker\nAction Input: {\"task\": \"Write one amazing paragraph about
      AI\", \"context\": \"We need a single paragraph with 4 sentences that describes
      the significance, potential, and impact of Artificial Intelligence. The paragraph
      should be engaging and insightful, capturing the essence of AI in a way that
      is both informative and captivating.\", \"coworker\": \"Senior Writer\"}\n\nObservation:
      Artificial Intelligence (AI) is revolutionizing the way we interact with technology,
      enabling machines to perform tasks that traditionally required human intelligence,
      such as understanding natural language, recognizing patterns, and making decisions.
      Its potential spans across various industries, from healthcare with AI-driven
      diagnostics and personalized treatment plans, to finance with sophisticated
      fraud detection and automated trading systems. The impact of AI is profound,
      as it not only enhances efficiency and productivity but also opens new frontiers
      for innovation and problem-solving. As we continue to advance in AI research
      and development, the possibilities for creating a smarter, more connected world
      are virtually limitless.\n", "role": "user"}], "model": "gpt-4o", "n": 1, "stop":
      ["\nObservation"], "stream": true, "temperature": 0.7}'
